// Name: Gamebox Tools
// ID: gmbxtools
// Description: Useful utilities for gamebox games.

(function (Scratch) {
    "use strict";

    const times = [];
    let fps = vm.runtime.frameLoop.framerate;
    const oldStep = vm.runtime._step;
    vm.runtime._step = function () {
      oldStep.call(this);
      const now = performance.now();
      while (times.length > 0 && times[0] <= now - 1000) {
        times.shift();
      }
      times.push(now);
      fps = times.length;
    };
  
    class gmbxtools {
      getInfo() {
        return {
          blockIconURI: "data:image/png;base64,",
          name: "Gamebox Tools",
          color1: "#0088ff",
          color2: "#0063ba",
          blocks: [
            {
                opcode: "get",
                blockType: Scratch.BlockType.REPORTER,
                text: "get [URL]",
                arguments: {
                  URL: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "https://extensions.turbowarp.org/hello.txt",
                  },
                },
              }, 
                          
            "---",
    
              {
                opcode: "restartProject",
                blockType: Scratch.BlockType.COMMAND,
                text: "restart project",
                arguments: {
                  TEXT: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "0",
                  },
                },
              },
                          
            "---",
    
              {
                opcode: "gfps",
                blockType: Scratch.BlockType.REPORTER,
                text: "fps",
              },
                                        
            "---",
    
              {
                opcode: "deleteSprite",
                blockType: Scratch.BlockType.COMMAND,
                text: "delete sprite [SPRITE]",
                arguments: {
                  SPRITE: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "Sprite1",
                  },
                },
              },
              
              {
                opcode: "deleteImage",
                blockType: Scratch.BlockType.COMMAND,
                text: "delete costume [COSNAME] in [SPRITE]",
                arguments: {
                  COSNAME: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "costume1",
                  },
                  SPRITE: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "Sprite1",
                  },
                },
              },
                          
            "---",
    
              {
                opcode: "renameSprite",
                blockType: Scratch.BlockType.COMMAND,
                text: "rename sprite [TARGET] to [NAME]",
                arguments: {
                  TARGET: {
                    type: Scratch.ArgumentType.STRING,
                    menu: "targets",
                  },
                  NAME: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "Sprite1",
                  },
                },
              },
                          
            "---",
    
              {
                opcode: "renameCostume",
                blockType: Scratch.BlockType.COMMAND,
                text: "rename costume [COSTUME] to [NAME]",
                arguments: {
                  COSTUME: {
                    type: Scratch.ArgumentType.COSTUME,
                  },
                  NAME: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "costume1",
                  },
                },
              },
              {
                opcode: "renameSound",
                blockType: Scratch.BlockType.COMMAND,
                text: "rename sound [SOUND] to [NAME]",
                arguments: {
                  SOUND: {
                    type: Scratch.ArgumentType.SOUND,
                  },
                  NAME: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "sound1",
                  },
                },
              },
                          
            "---",
    
              {
                opcode: "connected_to_internet_block",
                blockType: Scratch.BlockType.BOOLEAN,
                text: "connected to internet?",
              },
          ],
        };
      }
      get(args) {
        return Scratch.fetch(args.URL)
          .then((r) => r.text())
          .catch(() => "");
      }
      deleteSprite({ SPRITE }) {
        const target = vm.runtime.getSpriteTargetByName(SPRITE);
        if (!target || target.isStage) {
          return;
        }
        // @ts-expect-error
        if (typeof ScratchBlocks !== "undefined") {
          {
            return;
          }
        }
        vm.deleteSprite(target.id);
      }
      restartProject() {
        vm.greenFlag();
      }
      gfps() {
        return fps;
      }
 
      deleteImage({ SPRITE, COSNAME }) {
        // 0znzw, since shovel did not add it yet.
        const target = vm.runtime.getSpriteTargetByName(SPRITE);
        if (!target) {
          return;
        }
        target.deleteCostume(target.getCostumeIndexByName(COSNAME));
      }
      renameSprite(args, util) {
        const target = this._getTargetFromMenu(args.TARGET, util);
        if (!target || target.isStage) return;
  
        const name = Cast.toString(args.NAME);
        target.sprite.name = name;
      }
  
      renameCostume(args, util) {
        const target = util.target;
        const costumeName = Cast.toString(args.COSTUME);
        const costumeIndex = target.getCostumeIndexByName(costumeName);
        if (costumeIndex < 0) return;
  
        const name = Cast.toString(args.NAME);
        target.renameCostume(costumeIndex, name);
      }
  
      renameSound(args, util) {
        const target = util.target;
        const soundName = Cast.toString(args.SOUND);
        const soundIndex = this._getSoundIndexByName(soundName, util);
        if (soundIndex < 0) return;
  
        const name = Cast.toString(args.NAME);
        target.renameSound(soundIndex, name);
      }
      connected_to_internet_block() {
        try {
          return navigator.onLine;
        } catch (err) {
          return false;
        }
      }
    }
    Scratch.extensions.register(new gmbxtools());
  })(Scratch);